// File display ?a=view
function file(path) {
  var name = path.split('/').pop()
  var ext = name
    .split('.')
    .pop()
    .toLowerCase()
    .replace(`?a=view`, '')
    .toLowerCase()
  $('#content').html(
    `<div class="d-flex justify-content-center" style="height: 150px"><div class="spinner-border ${UI.loading_spinner_class} m-5" role="status"><span class="sr-only"></span></div></div>`,
  )
  if ('|html|php|css|go|java|js|json|txt|sh|md|'.indexOf(`|${ext}|`) >= 0) {
    return file_code(path)
  }

  if ('|mp4|webm|avi|'.indexOf(`|${ext}|`) >= 0) {
    return file_video(path)
  }

  if ('|mpg|mpeg|mkv|rm|rmvb|mov|wmv|asf|ts|flv|'.indexOf(`|${ext}|`) >= 0) {
    return file_video(path)
  }

  if ('|mp3|flac|wav|ogg|m4a|aac|'.indexOf(`|${ext}|`) >= 0) {
    return file_audio(path)
  }

  if ('|bmp|jpg|jpeg|png|gif|'.indexOf(`|${ext}|`) >= 0) {
    return file_image(path)
  }

  if ('pdf' === ext) {
    return file_pdf(path)
  } else {
    return file_others(path)
  }
}

